import React, { useState } from "react";
import Menu from "./Menu";
import "./Navbar.css";

const Navbar = () => {
  const [open, setOpen] = useState(false);

  return (
    <nav className="navbar">
      <Menu open={open} setOpen={setOpen} />
    </nav>
  );
};

export default Navbar;
